import './App.css';
import { BrowserRouter as Router,Route,Switch } from 'react-router-dom';
import HeaderComponent from './components/HeaderComponent';
import ListaComponentsDependencias from './components/ListaComponentsDependencias';
import AddUbicacionComponent from './components/AddUbicacionComponent';

class App extends Component {

  render(){
      return(
          <Router>
              <Switch>   
                  <Route exact path ="/" element ={<ListaComponentsDependencias/>}></Route>
            <Route path ="/Buzon" element ={<ListaComponentsDependencias/>}></Route> 
            <Route path ="/add-Ubicacion" element ={<AddUbicacionComponent/>}></Route>    
            <Route path ="/edit-Ubicacion/:id" element ={<AddUbicacionComponent/>}></Route>                 
              </Switch>
          </Router>
      )
  }


}

export default App;
